import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";

export default function SuperUserSignUp() {
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    confirmPassword: "",
  });

  const [isSignUpSuccessful, setIsSignUpSuccessful] = useState(false);
  const [alertMessage, setAlertMessage] = useState("");

  const navigate = useNavigate();

  useEffect(() => {
    // Check if the user is authenticated as a Super User.
    // You can use your authentication mechanism here.
    const isAuthenticated = checkAuthenticationStatus(); // Implement this function

    if (isAuthenticated) {
      // If authenticated, redirect to the Super User dashboard or any other page.
      navigate("/superUser/dashboard"); // Modify the URL as needed.
    }
  }, [navigate]);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      alert("Password and Confirm Password do not match.");
      return;
    }

    // The rest of your sign-up code here
  };

  return (
    <div>
      <form className="signup_form" onSubmit={handleSubmit}>
        <h1 className="heading">Super User Sign-Up</h1>
        {isSignUpSuccessful && (
          <div className="alert alert-success" role="alert">
            {alertMessage}
          </div>
        )}
        <div className="larger_inputContainer">
          <div className="mb-3">
            <input
              className="form-control larger_input"
              type="email"
              placeholder="Email"
              name="email"
              value={formData.email}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="mb-3">
            <input
              className="form-control larger_input"
              type="password"
              placeholder="Password"
              name="password"
              value={formData.password}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="mb-3">
            <input
              className="form-control larger_input"
              type="password"
              placeholder="Confirm Password"
              name="confirmPassword"
              value={formData.confirmPassword}
              onChange={handleInputChange}
              required
            />
          </div>
        </div>
        <button type="submit" className="btn btn-primary button">
          Sign Up
        </button>
        <div className="own_account">
          <Link to="/superUser/signin">Already have an account? Sign In</Link>
        </div>
      </form>
    </div>
  );
}
